  <|"ID" -> 1148606690528509954, "Text" -> "\[OpenCurlyDoubleQuote]If you \
want to be sure your online activity stays private, make sure you choose a \
VPN which does not log your internet activity and online \
traffic,\[CloseCurlyDoubleQuote] the guidance says. \
\[OpenCurlyDoubleQuote]Not all VPNs are the same. Make sure you do your \
research before choosing a VPN.\[CloseCurlyDoubleQuote]", 
   "CreationDate" -> DateObject[{2019, 7, 9, 10, 55, 49.}, "Instant", 
     "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, "symbols" -> {}, 
