   "FavoriteCount" -> 10, "RetweetCount" -> 7|>, 
  <|"ID" -> 1148606687298904064, "Text" -> "Big Brother Watch recommends that \
free VPNs should be avoided because they may not be secure and could track \
users.", "CreationDate" -> DateObject[{2019, 7, 9, 10, 55, 48.}, "Instant", 
     "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, "symbols" -> {}, 
     "user_mentions" -> {}, "urls" -> {}|>, "Language" -> "en", 
   "FavoriteCount" -> 11, "RetweetCount" -> 7|>, 
  <|"ID" -> 1148606685310664706, "Text" -> "The ability to access the data \
held by VPN providers, could enable governments or other organisations to \
identify users and their activity online. This potentially puts human rights \
activists, privacy advocates, investigative journalists and whistleblowers in \
jeopardy.", "CreationDate" -> DateObject[{2019, 7, 9, 10, 55, 48.}, 
     "Instant", "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 4, "RetweetCount" -> 3|>, 
  <|"ID" -> 1148606683104600064, "Text" -> "For example, seven of the top VPN \
services are owned by Gaditek, based in Pakistan. This means the Pakistani \
government can legally access any data without a warrant and data can also be \
freely handed over to foreign institutions, according to VPNpro.", 
   "CreationDate" -> DateObject[{2019, 7, 9, 10, 55, 47.}, "Instant", 
     "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, "symbols" -> {}, 
     "user_mentions" -> {}, "urls" -> {}|>, "Language" -> "en", 
   "FavoriteCount" -> 12, "RetweetCount" -> 10|>, 
  <|"ID" -> 1148606679241674752, "Text" -> "Although the ownership of a \
