     "user_mentions" -> {}, "urls" -> {}|>, "Language" -> "en", 
   "FavoriteCount" -> 4, "RetweetCount" -> 2|>, 
  <|"ID" -> 1148606675554668544, "Text" -> "In some instances, ownership of \
different VPNs is split amongst a number of subsidiaries. Chinese company \
Innovative Connecting owns 3 businesses that produce VPN apps: Autumn Breeze \
2018, Lemon Cove &amp; All Connected. In total, Innovative Connecting owns 10 \
VPN products.", "CreationDate" -> DateObject[{2019, 7, 9, 10, 55, 46.}, 
     "Instant", "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 4, "RetweetCount" -> 4|>, 
  <|"ID" -> 1148606669171101696, "Text" -> "The study shows that the top 97 \
