     "urls" -> {}|>, "Language" -> "en", "FavoriteCount" -> 3, 
   "RetweetCount" -> 1|>, <|"ID" -> 1148588995967778822, 
   "Text" -> "The Navy is working with the Army to develop a booster for \
hypersonic missiles, and the Army teamed up with the Navy and Air Force to \
build a hypersonic glider that can outmaneuver the world's most advanced \
missile defense shields.", "CreationDate" -> 
