     "urls" -> {}|>, "Language" -> "en", "FavoriteCount" -> 5, 
   "RetweetCount" -> 2|>, <|"ID" -> 1148588992587112448, 
   "Text" -> "Thomas Callender, a retired submarine officer and analyst with \
the Heritage Foundation, said the Pentagon had spurred programs to field \
hypersonic weapons that can strike Russia and China. These weapons would \
likely be placed on submarines first, then on surface ships.", 
   "CreationDate" -> DateObject[{2019, 7, 9, 9, 45, 30.}, "Instant", 
