     "user_mentions" -> {}, "urls" -> {}|>, "Language" -> "en", 
   "FavoriteCount" -> 3, "RetweetCount" -> 1|>, 
  <|"ID" -> 1148588988741013504, "Text" -> "There are 66 Arleigh Burke-class \
