South China Sea, sometimes 12 nautical miles away from China's militarized \
islands.", "CreationDate" -> DateObject[{2019, 7, 9, 9, 45, 29.}, "Instant", 
     "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, "symbols" -> {}, 
     "user_mentions" -> {}, "urls" -> {}|>, "Language" -> "en", 
   "FavoriteCount" -> 1, "RetweetCount" -> 1|>, 
  <|"ID" -> 1148588985477763074, "Text" -> "Allowing launchers to fire \
hypersonic missiles on destroyers would considerably increase the \
effectiveness of the Navy's strike capabilities. Current weapons on these \
vessels include Tomahawk Land Attack Missile, a subsonic missile that can \
easily be defeated by Russia &amp; China.", "CreationDate" -> 
    DateObject[{2019, 7, 9, 9, 45, 28.}, "Instant", "Gregorian", -4.], 
   "Entities" -> <|"hashtags" -> {}, "symbols" -> {}, "user_mentions" -> {}, 
