  <|"ID" -> 1148536371662843904, "Text" -> "Back in February, KMT leader Wu \
Den-yih suggested a peace deal with mainland China. But the recent events in \
Hong Kong has prompted many prominent party members to distance themselves \
from the regime.", "CreationDate" -> DateObject[{2019, 7, 9, 6, 16, 24.}, 
     "Instant", "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 3, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148536368210968576, "Text" -> "Unlike the incumbent DPP, which \
has consistently criticized the Chinese regime\[CloseCurlyQuote]s aggressive \
policies and called out the regime\[CloseCurlyQuote]s infiltration tactics, \
the KMT has favored more Beijing-friendly approaches in recent decades.", 
   "CreationDate" -> DateObject[{2019, 7, 9, 6, 16, 23.}, "Instant", 
     "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, "symbols" -> {}, 
     "user_mentions" -> {}, "urls" -> {}|>, "Language" -> "en", 
   "FavoriteCount" -> 1, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148536366130585602, "Text" -> "Tens of thousands of people \
occupied the Taiwanese legislature for 23 days to oppose a free trade \
agreement with China that critics feared would harm Taiwan\[CloseCurlyQuote]s \
autonomy.", "CreationDate" -> DateObject[{2019, 7, 9, 6, 16, 23.}, "Instant", 
     "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, "symbols" -> {}, 
     "user_mentions" -> {}, "urls" -> {}|>, "Language" -> "en", 
   "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148536362447994881, "Text" -> "Taiwan locals have compared the \
protests in Hong Kong, which have drawn millions to the streets over the past \
few weeks, with Taiwan\[CloseCurlyQuote]s student-led Sunflower Movement back \
in 2014.", "CreationDate" -> DateObject[{2019, 7, 9, 6, 16, 22.}, "Instant", 
     "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, "symbols" -> {}, 
     "user_mentions" -> {}, "urls" -> {}|>, "Language" -> "en", 
   "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148536360459886592, "Text" -> "The bipartisan support for the \
Hong Kong protesters come amid growing concerns of the Chinese \
regime\[CloseCurlyQuote]s influence on the island, including through election \
meddling and infiltrating local media outlets.", 
   "CreationDate" -> DateObject[{2019, 7, 9, 6, 16, 21.}, "Instant", 
     "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, "symbols" -> {}, 
     "user_mentions" -> {}, "urls" -> {}|>, "Language" -> "en", 
   "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148536357892964353, "Text" -> "The KMT also previously issued a \
statement following a mass protest on June 12, calling for the Hong Kong \
government to listen to the voices of the people and protect universal \
